import ContentLoader from "react-content-loader";
import './styles.css';

const CardLoader = () => (
  <div className = "card-loader-container">
  <ContentLoader 
    speed={2}
    width={320}
    height={300}
    viewBox="0 0 320 460"
    backgroundColor="#bbb"
    foregroundColor="#acebeb"
    >
    <rect x="0" y="0" rx="3" ry="3" width="300" height="300" />
  </ContentLoader>
  </div>
)

export default CardLoader;
